import React from 'react';

import SearchInput from './components/searchInput/SearchInput';
import ThisDayWeather from './components/thisDayWeather/ThisDayWeather';

import { MainWrapper } from './styledComponents/App';
import GlobalStyle from '../styledComponents/GlobalStyle';
import weatherIcon from '../assets/image/weatherIcon.png'

const App = () => {
  return (
    <MainWrapper>
      <img 
        src={weatherIcon}

      />
      <h1>Weather App</h1>
      <SearchInput />
      <ThisDayWeather />
      <GlobalStyle />
    </MainWrapper>
  );
};

export default App;
